import React from 'react';
import logo from '../logo.svg';

async authenticate => {
  console.log("hello");
}

function Header(props) {

  return(
    <div>
      <img src={logo} className="logo" alt="logo" />
      <h1>DUBZOO</h1>
      <button onClick={authenticate}>LOGIN</button>
    </div>
  );
}

export default Header;
